", "selected": false}, {"label": "Savoir repérer et connaitre, les vitrines bijoux de chaque zone bénéficiant l'avantage carte 50% Doc N°1", "selected": false}, {"label": "Savoir respecter le référent la photo", "selected": false}, {"label": "Savoir où se trouve le comptoir carte fidélité.", "selected": false}, {"label": "Savoir où se font les TSV - la prise des SAV (hors et sous garantie) clients.", "selected": false}, {"label": "Savoir où se font les services minutes dans l'établissement.", "selected": false}, {"label": "Savoir où se trouvent les produits d'entretien de votre zone.", "selected": false}], "title": "4° SAVOIR SE REPÉRER DANS SON PLAN MERCHANDISING - ENTRETIEN DE SA ZONE"}, {"items": [{"label": "Savoir ouvrir avec la clef, une vitrine mode, en respectant l'ouverture en sécurité. \\n \\n objectif: le client doit toujours avoir la vitre fermée devant lui. \\n \\n Pour y arriver vous devez: \\n \\n - Poser votre plateau de présentation devant la vitre qui doit rester fermée, Toujours devant votre client. \\n \\n - Vous déplacer en invitant le client à rejoindre le plateau que vous aurez \\n repositionner devant la vitre opposée à celle que vous ouvrez.", "selected": false}], "title": "5° L'OUVERTURE DES VITRINES MODE ( Zone MODE )"}, {"items": [{"label": "Savoir ouvrir avec le badge une vitrine de la zone or", "selected": false}, {"label": "Savoir où se trouvent les capteurs", "selected": false}, {"label": "Savoir fermer délicatement la vitrine", "selected": false}, {"label": "Savoir qu'en cas de choc, toutes les vitrines BLACK de Diamantor se bloquent pendant 10 minutes", "selected": false}, {"label": "Savoir que si vous badgez une vitrine pour contrôler l'ouverture dans la foulée, \\n cela peux prolonger de 10 minutes supplémentaires", "selected": false}, {"label": "Savoir que si une vitrine est déjà ouverte sur une zone de l'or, il faut qu'elle soit \\n refermée, pour pouvoir à son tour, ouvrir une nouvelle vitrine.", "selected": false}, {"label": "S